Here is a sample contract implementation in Solidity:

```solidity
// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

contract Token {
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public totalsupply;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    address public transfer;
    address public proposedowner;
    uint8 public finalized;
    uint256 public buypriceeth;
    uint256 public sellpriceeth;
    uint256 public gasforpbtt;
    uint256 public pbttforgas;
    uint256 public gasreserve;
    uint256 public minbalanceforaccounts;
    uint256 public tokenremaining;
    uint8 public halts;

    constructor() public payable {
        buypriceeth = 0xb5e620f48000;
        sellpriceeth = 0x5af3107a4000;
        gasforpbtt = 0x11c37937e08000;
        pbttforgas = 1;
        gasreserve = 0xde0b6b3a7640000;
        minbalanceforaccounts = 0x11c37937e08000;
        tokenremaining = 0;
        if (msg.value == 0) {
            decimals = 3;
            totalsupply = 0xe8d4a51000;
            balanceof[msg.sender] = 0xe8d4a51000;
            allowance[msg.sender][msg.sender] = 0xe8d4a51000;
            transfer = msg.sender;
            finalized = 0;
            halts = 0;
        }
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function setPBTTForGas(uint256 _value) public {
        require(msg.sender == transfer);
        pbttforgas = _value;
    }

    function setGasForPBTT(uint256 _value) public {
        require(msg.sender == transfer);
        gasforpbtt = _value;
    }

    function setGasReserve(uint256 _value) public {
        require(msg.sender == transfer);
        gasreserve = _value;
    }

    function unhaltsTrades() public {
        require(msg.sender == transfer);
        halts = 0;
    }

    function withdrawFundToOwner() public {
        require(msg.sender == transfer);
        msg.sender.transfer(address(this).balance);
    }

    function finalize() public {
        require(msg.sender == transfer);
        require(finalized == 0);
        finalized = 1;
    }

    function setEtherPrices(uint256 _newBuyPrice, uint256 _newSellPrice) public {
        require(msg.sender == transfer);
        buypriceeth = _newBuyPrice;
        sellpriceeth = _newSellPrice;
    }

    // Rest of the functions...
}
```

